import React, { Component } from 'react';

class Like extends Component {
    IconClass(){
        return `${this.props.IsLiked? "fas":"far"} fa-heart`
    }
    render() { 
        return (
            <i onClick={()=>{this.props.onClick(this.props.movie)}} className={this.IconClass()}></i>
        );
    }
}
 
export default Like;
